import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import FCLogo from '../assets/FCLogo.png'
import Nav from 'react-bootstrap/Nav';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { Link } from "react-router-dom";
import FCSpinner from "../assets/FCSpinner.png"

export default function NavComp() {
  return (
<>
{[false].map((expand) => (
  <Navbar key={expand} variant="dark" expand={expand} className="mb-3">
    <Container fluid>
      <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
      <Navbar.Brand href="#"><img className="img-fluid" alt="Fighting Chance" href="#" src={FCLogo} /></Navbar.Brand>
      <span></span>
      <Navbar.Offcanvas
        id={`offcanvasNavbar-expand-${expand}`}
        aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
        placement="start"
      >
        <Offcanvas.Header closeButton>
          <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
          <img className="img-fluid" width="75px" alt="Fighting Chance" href="#" src={FCSpinner} /> SITE MAP
          </Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          <Nav className="justify-content-end flex-grow-1">
            <span className="ps-3"><Link className="nav-link" to={'/'}>Home</Link></span>
            <span className="ps-3"><Link className="nav-link" to={'/encounter'}>Generator</Link></span>
            <span className="ps-3"><Link className="nav-link" to={'/about'}>About</Link></span>
            <span className="ps-3"><Link className="nav-link" to={'/team'}>Team</Link></span>

          </Nav>
        </Offcanvas.Body>
      </Navbar.Offcanvas>
    </Container>
  </Navbar>
))}
</>


  );
}
